import '../App.css'
import '../Estilos/Shop.css'
import Productos from './Productos';


const Shop = (props)=>{
    return (
        <div className="contenedor-img">
            <h2>Productos</h2>
            <Productos />
        </div>
    )
}
export default Shop;
